import React, { useState, useEffect } from "react";
import ComServices from "../../services/com.service";
import AuthService from "../../services/auth.service";
import "../../styles/com.css";

const Com = ({ id }) => {
    const currentUser = AuthService.getCurrentUser();
    const [message, setMessage] = useState("");
    const [coms, setComs] = useState([]);
    const [com, setCom] = useState("");

    useEffect(() => {
        getComs();
    }, []);

    async function getComs() {
        const response = await ComServices.getAll(id);

        console.log("coucou");
        setComs(response);
    }
    function contentChange(event) {
        const { name, value } = event.target;
        setCom({ ...com, [name]: value }); // on change add new object in post from the value name
    }
    function createCom(e) {
        e.preventDefault();
        setMessage("");
        var data = {
            author: currentUser.nickname,
            postId: id,
            content: com.content,
        };
        ComServices.create(data)
            .then((data) => {
                setMessage("Commentaire créer avec succès");
                return data;
            })
            .catch((error) => {
                const resMessage = error.response.data.message;
                setMessage(resMessage);
            });
        getComs();
    }
    return (
        <div className="container_com">
            <form contentype="multipart/form-data">
                <label className="label_com flex" htmlFor="content">
                    Commenter :
                    <textarea
                        id="content"
                        type="text"
                        className="txt_com"
                        onChange={contentChange}
                        name="content"
                        value={com.content}
                    />
                </label>
                <button onClick={createCom}>Ajouter</button>
                {message && (
                    <div className="alert alert-danger" role="alert">
                        {message}
                    </div>
                )}
            </form>
            {coms &&
                coms.map((com) => (
                    <span>
                        <p>{com.author}</p>
                        <p>{com.content}</p>
                    </span>
                ))}
        </div>
    );
};

export default Com;
